import React from "react";
import HeaderBody from "../../components/HeaderBody/HeaderBody";
import style from './Person.module.css'
import { NavLink } from "react-router-dom";

function Person() {
  return (
    <div className={style.body}>
      <div className={style.container}>
        <HeaderBody />
        <div className={style.title}>
            <h4>Choose your fighter</h4>
        </div>
        <div className={style.person}>
            <div className={style.block1}><NavLink to="/info"><img src="/zombie.png" alt=""/></NavLink>  </div>
            <div className={style.block2}><NavLink to="/info"><img src="/zombie.png" alt=""/></NavLink> </div>
            <div className={style.block3}><NavLink to="/info"><img src="/zombie.png" alt=""/></NavLink> </div>
            <div className={style.block4}><NavLink to="/info"><img src="/zombie.png" alt=""/></NavLink> </div>
            <div className={style.block5}><NavLink to="/info"><img src="/zombie.png" alt=""/></NavLink> </div>
            <div className={style.block6}><NavLink to="/info"><img src="/zombie.png" alt=""/></NavLink> </div>
        </div>
      </div>
    </div>
  )
}

export default Person;
